@Сергей Кузнецов "Вы четко сказали, что "чем выше частота, тем большая нужна мощность"! Абсолютная ересь, потому что вы путаете, что различные среды по разному пропускают, рассеивают или отражают радиоволны."
__
Давайте так - для 450 мГц (cdma ) -  открытое поле - две штыревые антенны - мощность 1 Вт - связь ( предел ) - допустим - 5 км. Для 900 м Гц ( gsm ) - мощность 1 Вт ) - связь (предел) - 2,5 км. Для 1800 мГц - предел дальности при 1 ватт будет уже 1.25 км. При 3600 мГц -  625 метров. Я ГОТОВ ПОВТОРИТЬ,   "чем выше частота, тем большая нужна мощность"!  при той же дальности между антеннами в открытом пространстве (пока дальность не ограничена видимостью), увеличение частоты в 2 раза увеличивает требования к мощности передатчика в 4 раза.  Но при ТОЙ ЖЕ МОЩНОСТИ для более высокочастотных BTS для обеспечения покрытия надо много БОЛЬШЕ BTS. А это означает , что вероятность попасть в зону рядом с источником сильно увеличивается.  По-моему весьма доступно. а это ВЫСОКОЧАСТОТНЫЕ источники и их МНОГО. А как влияют мощные сантиметровые волны  на организм не понятно . Многие пишут снижается иммунитет.

