@Тетрапак Молокоев С какой вы командой поработали - с детсадовской? У вас у конспирологов просто базовая логика отсутствует, вы сами себя разоблачаете такими видео, которые тут кидаете. Я глянул видео с пресс-конференции белого дома, оно может подтверждать только одно - что никакого заговора в правительстве США не существует, т.к. очевидно что они боятся заразится и уверенны в большой смертности все время до выхода исследования Университета Южной Калифорнии, т.е. они не врали все это время про опасность вируса, они и в правду так считали и вот вышло исследование Южной Калифорнии и они друг друга подбадривают - что мол смертность не высокая по предположениям(!!!) этого исследования. Был бы у них заговор на протяжении последних месяцев - они бы не обсуждали никакие исследования, а знали что ковид не существует. Кроме того там же он говорит что исследование опубликовано - значит вообще никто ничего не скрывает. Я не смотрел это исследование, но по всей видимости - либо этот политик не правильно его понял, либо оно совсем не надежное, иначе - уже бы все сми трубили о том что новое исследование доказало что смертность от ковид всего 0.1%. 
Вы же так хотите верить в свои теории настолько, что простой разговор двух чиновников, в котором они обсуждают новое исследование, разговор , который по сути говорит о том, что они до этого разговора были уверены в высокой смертности(т.е. у них не было данных что ковид не опасен и они не скрывали такие данные), короче у вас в голове этот разговор превращается наоборот - в докозательство теории заговора. И так всегда происходит у конспиролухов - вы сами не замечаете элементарных логических ошибок, подгоняете факты так как вам удобно, кто-то наверное делает это даже осознанно, но вы похоже неосознанно приняли разговор по сути доказывающий честность чиновников на протяжении всего времени до исследования за доказательство заговора. Ну сами подумайте - зачем бы им обсуждать какие-то исследования( и снимать или не снимать маску), если они и так знают что вирус неопасен и правительство врет ради каких-то там злых целей? Но такой простой казалось бы вопрос вам и в голову не пришел, т.к. мозг конспиролога так устроен - опускает все что не бьется с теорией заговора, а подмечает только то что можно натянуть на эту теорию.
Скорее всего вообще чиновник неправильно понял исследования или это фигня какая-то, а не исследования и толковых доказательств там нету. Как они вообще насчитали 200-400тысяч(или сколько там было) инфицированных в Калифорнии в этом исследовании, если официально подтвержденных на тот момент 7 тысяч всего было, если я правильно понял?

@One Dollar to rule them all ваши примеры здоровых непривитых детей здоровы лишь потому, что живут в обществе, где привито более 90-95% населения. Болезни не от кого передаться.
Это называется коллективный иммунитет.
Если непривитых станет много, болезни могут вернуться. А это страшные болезни которые делают детей инвалидами. Готовы принести в жертву своему ребенку мучения и страдания сотен  детей в будущем поколении? Если вдруг критическая масса людей перестанет прививать детей?

@Максим Кац или так: в основном от болезней умирают непривитые и антипрививочники всех возрастов. При чем, чем больше прививок наставил - тем меньше шансов умереть. Я бы, конечно, во все это поверил, если бы это было правдой. На самом деле у меня куча живых примеров, где непривитые дети имеют крепкий иммунитет. При чем, если и болеют, то болеют одинаково и с привитыми. Прививки, в принципе, целесообразно вводить в график по эпидемиологическим показаниям. В это еще можно поверить. Но я не знаю ни одно авторитетное исследование или статистику, утверждающие, что вакцины дают хотя бы +50% к иммунитету по сравнению с непривитыми. Или что детская смертность исключительно происходит из-за отсутствия прививки. А что, если дети становятся инвалидами и умирают как раз и из-за прививок? Такие указания тоже есть. 
Мне в детстве ставили прививки, и далеко не все. Но от болезней меня это не спасало. И грипп, и различные орви часто меня доставали. Не делаю никакие прививки еще с юношества. Я не против прививок, но по особым случаям. И потом, я не вижу связи между липовой пандемией ковида и развернутой компанией по вакцинации. Т. е. я знаю, что и то, и другое лживо в принципе. 
Я вам еще сыои соображения оставлял в другом комментарии по поводу пандемии короновируса. Т. е. как это видим мы, обычные обыватели, имеющие возможность общаться с др. людьми и анализировать. Я ничего не утверждаю, но все же.

@Александр Качура, смотрю дальше, вижу, что он очень грамотно обходит другие варианты переработки растительных отходов, которые уже давно используют в той же Швеции. А именно, производство биотоплива из отходов от растений, а также тех же удобрений. Отходы от животноводства он гладенько так обошёл.
Также он неправильно использует термины. Сельское хозяйство - это и растениеводство, и животноводство.
Далее можно сказать, что животноводство в принципе не является необходимостью, в отличие от растений, поэтому главный шаг для экологии - ликвидация этой сферы.

