@Александр Качура, только этот блоггер несёт неадекватный бред и подгоняет факты под себя.
Невозможно быть экологичным, если ты не веган.
Животноводство наносит огромный удар парниковыми газами, а также занимает земли, которые могли занять растения для пропитания. Также большая часть растительной пищи выращивается для животноводства. Но об этом почему-то никто из таких "экспертов" не говорит.

@Ekaterina Dekalenkova но в статье нигде не написано про веганство, просто говорится, что полезно есть побольше овощей и по меньше насыщенных жиров, а точнее уменьшить их долю до 10%, но не написано исключить. 
Веганство же исключает животные продукты полностью. ВОЗ так же советует не есть много соли, но не пишет ее исключить, исключение соли приведет к печальным последствиям, как и исключение мяса (его будет очень сложно заменить без молока и яиц и очень дорого)
А в том видео Цацулина говорится не только о здоровье человека, но и планеты.

@Consensus 9 вот ты мудак. логика "даже в отсталом государстве ковид не нашли, значит его нет" она ж из анекдота про достижения науки в средние века. 
Армянское радио сообщило, что на раскопках в Ереване нашли проволоку, что говорит о том, что у древних армян был телеграф. На что грузинское радио ответило, что на раскопках в Тбилиси проволоки не нашли - это свидетельствует о том, что у древних грузин был беспроволочный телеграф.
ладно, не отвечай. дураков учить, только портить. вот вас таких надо привить наночипом, потом выявить и доступ в интернет запретить, а раздать учебники и в научную библиотеку записать, чтобы такие придурки писали рефераты об анализе статистики, пользе прививок и вреде антипрививочников.

@Galina Y меня смущает то, что Вы ведясь на непрофессионализм и некомпетентность журналистов, заявляете что в Швеции 24,000 заболевших. То есть Вы не понимаете, в чем разница между заболевшим и инфицированным, так же как очевидно не в курсе давно установленного факта, что подавляющая часть, более 90% выносят его бессимптомно, и то же верно даже для пожилых людей. Но Вы не знакомитесь с научно обоснованными данными, Вы читаете прессу и оттуда Ваша истерика.
Попереживайте лучше насчет того, что благодаря коллективным усилиям адвокатов карантина 265 миллионов человек (свежие данные ООН) поставлены под угрозу голодной смерти. Дополнительно ко всему, невозможность оказания мед.помощи другим заболевшим привела к тому, что ещё несколько миллионов дополнительных смертей произойдут из-за туберкулеза. 
Ну что, доигрались в филантропов, незванные вы наши спасители человеческих жизней?

